import React from 'react';
import s from "./Button.module.css";
import {NavLink} from "react-router-dom";

const Button = (props) => {
  const handleOnClick = () => {
    props.closeMenu();
    props.handle();
  }

  return (
      <NavLink className={s.btn__link} to={props.to} onClick={handleOnClick}>
        <div className={s.btn}><img src={props.src} alt={props.alt} onBlur={props.closeMenu}/>{props.text}</div>
      </NavLink>
  );
};

export default Button;
